import React from 'react';
import webimg from './img/pic.jpg';

const Home = () => {


    return (
        <>

            <section id="header" className="">
                <div className="container">
                

                                <div className="col-md-6 pt-5 pt-ig-0 order-2 order-lg-1"></div>
                                <h1>Grow Your Self With <strong className="brand">ASzEn</strong></h1>
                                <h2 className="my-3">We Are Team Of Building Future</h2>
                                <div className="mt-3">
                                    <button href="#" className="btn-get-start"> Get Started</button>
                                </div>
                                <div className="header-img">
                                    <img src={webimg} className="img-fluid animated" alt="images" />
                                </div>
                </div>
            </section>
        </>
    );
}

export default Home;
